MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Calibre Interactive provides a GUI interface to several Calibre tools. The interface enables you to customize rule file settings and run-time options. You can submit jobs on local, remote, or distributed computer resources.");
MGCAddSnippet(6, "Calibre Interactive is a GUI interface to Calibre nmDRC, Calibre nmLVS, Calibre parasitic extraction tools, Calibre PERC, Calibre DFM, and Calibre 3DSTACK. You can easily adjust rule file settings and run-time options without editing the rule file, then submit the Calibre job on a local, remote, or distributed computer resource. ");
MGCAddSnippet(7, "Calibre Interactive and Calibre RVE are essential components of an interactive workflow using Calibre physical verification tools. Calibre Interactive and RVE are integrated to most standard industry design tools,");
MGCAddSnippet(8, "Certain requirements for the computing platform, licensing, and environment variables must be met in order to run Calibre Interactive. ");
MGCAddSnippet(9, "Calibre Interactive and Calibre RVE can establish connections to most standard industry design tools. This section describes where to find setup and operation information. ");
MGCAddSnippet(10, "The command descriptions use font properties and several metacharacters to document the command syntax. ");
MGCAddSnippet(11, "Knowledge of some basic Calibre Interactive features such as runsets, controls files, preferences, and file naming templates is helpful before running Calibre Interactive.");
MGCAddSnippet(12, "Calibre Interactive uses several important files and directories.");
MGCAddSnippet(13, "A runset is a text file created by Calibre Interactive to store the settings you specify in the GUI. You can load a runset into Calibre Interactive to restore the GUI interface to the saved settings. You also use a runset to run Calibre Interactive in batch mode. ");
MGCAddSnippet(14, "Calibre Interactive treats runset data differently depending on whether you invoke the tool from a design tool or from the command line.");
MGCAddSnippet(15, "You can use a default runset to specify custom default settings for Calibre Interactive. Default runsets are used only when no other runset is loaded. ");
MGCAddSnippet(16, "A Calibre Interactive runset is a text file that contains variable names and values corresponding to settings in the Calibre Interactive GUI. A runset is used to restore saved settings to the GUI and to control Calibre Interactive batch runs.");
MGCAddSnippet(17, "A Calibre Interactive runset is a text file that stores the Calibre Interactive GUI settings. You can load a runset in a later Calibre Interactive session to restore the GUI settings.");
MGCAddSnippet(18, "You can load a Calibre Interactive runset from the command line, from the GUI, or by defining an environment variable. Preference settings allow you to save the runset automatically. ");
MGCAddSnippet(19, "There are several methods to load a Calibre Interactive runset automatically on invocation. You can use a command line option, an environment variable, or a startup preference setting. ");
MGCAddSnippet(20, "Define the environment variable MGC_CALIBRE_DRC_RUNSET_LIST to point to a file with the list of runsets to display in the Load Runset File dialog box. Replace DRC in the environment variable name with LVS, PERC, PEX, or DFM for those applications. The dialog box is displayed with the specified list of runsets when you invoke Calibre Interactive. Multiple files may be specified as a space-separated list.");
MGCAddSnippet(21, "Define the environment variable MGC_CALIBRE_DRC_RUNSET_FILE to point the runset(s) you want to load. Replace DRC in the environment variable name with LVS, PERC, PEX, or DFM for those applications. The runset(s) is loaded when you start Calibre Interactive. ");
MGCAddSnippet(22, "You can load one or more runsets into Calibre Interactive using a startup preference. When multiple runsets are used, they are loaded in order and the settings loaded last take precedence. ");
MGCAddSnippet(23, "When multiple runsets are loaded in Calibre Interactive, they are loaded in order and the settings loaded last take precedence. You can use multiple runsets to combine runsets that include different sets of options. For example, you can combine a basic runset with a second runset that contains settings for output options or host processor control.");
MGCAddSnippet(24, "Calibre Interactive saves only non-default values to a runset file unless you set an environment variable to change this behavior. To save all GUI settings (both non-default and default settings) to the runset file, set the environment variable MGC_CALIBRE_SAVE_ALL_RUNSET_VALUES to a non-zero value. ");
MGCAddSnippet(25, "You can give a runset a label and descriptive comment using the Runset Type and Runset Info fields. These fields are located in the Setup Preferences dialog box (SetupPreferences), on the Info tab.");
MGCAddSnippet(26, "The control file in Calibre Interactive contains the settings in the GUI. ");
MGCAddSnippet(27, "The Calibre Interactive control file provides all the information Calibre needs to process data, based on the settings you define in the user interface.");
MGCAddSnippet(28, "Calibre Interactive writes the control file to the run directory with a name that is based upon the loaded rule file, with preceding and succeeding underscores (_).");
MGCAddSnippet(29, "You can instruct Calibre Interactive to create a control file based on the current GUI settings. This is useful if you want to view the control file before starting the run.");
MGCAddSnippet(30, "Calibre Interactive can create a control file that you can use as the rule file for a command line Calibre run. The control file includes GUI settings from your Calibre Interactive setup, such as check selection, top cell name, and other settings. ");
MGCAddSnippet(31, "Rule files define the processing Calibre performs during a run. You specify the rule file for a Calibre Interactive run on the Rules pane. ");
MGCAddSnippet(32, "When working with rule files in Calibre Interactive you can view and edit the rule file, check the rule file syntax, select the rule checks to execute, and load rule file settings into the Calibre Interactive GUI.");
MGCAddSnippet(33, "Calibre uses the control file to define the run. The primary rule file that you define in the Rules pane is included in the Calibre run as an Include file in the Calibre Interactive control file. When Calibre compiles a control file, the settings in the control file take precedence over any corresponding settings in the rule file. In other words, the GUI settings at the time the job is initiated control how the job is run.");
MGCAddSnippet(34, "Features such as color coding and setting environment variables simplify the use of Calibre Interactive. ");
MGCAddSnippet(35, "The left side of the Calibre Interactive window contains buttons that either select the GUI pane that is displayed or initiate an action. ");
MGCAddSnippet(36, "The contents of the Setup menu in Calibre Interactive depend on the application you are running.");
MGCAddSnippet(37, "You can use environment variables in Calibre Interactive fields and runsets with some restrictions.");
MGCAddSnippet(38, "The user interface uses color coding to indicate status.");
MGCAddSnippet(39, "Most file entry fields in Calibre Interactive allow you to select the file from a file browser. ");
MGCAddSnippet(40, "Some options and setup procedures pertain to all of the Calibre Interactive applications.");
MGCAddSnippet(41, "You can invoke Calibre Interactive from a supported design tool or from the command line. ");
MGCAddSnippet(42, "When you start Calibre Interactive from a layout or schematic viewer, communication is automatically set up between Calibre Interactive and the viewer. You can specify that Calibre Interactive use the open layout or schematic as input for the Calibre run.");
MGCAddSnippet(43, "Command line invocation of Calibre Interactive can open the GUI or start a Calibre Interactive batch run.");
MGCAddSnippet(44, "There are several options for setting up the timeout of your Calibre Interactive license. ");
MGCAddSnippet(45, "Command line invocation for Calibre Interactive. ");
MGCAddSnippet(46, "When your Calibre Interactive session is connected to a supported layout or schematic viewer, you can use the open design as input for your Calibre run; this is referred to as layout and schematic export. Socket ports are used for communication between Calibre Interactive and the design tool.");
MGCAddSnippet(47, "The  Export from layout  and  Export from schematic  settings on the Inputs pane of Calibre Interactive are used to specify the open layout or schematic in an connected viewer to be the input for your Calibre run. Layout and schematic export is possible for both interactive and batch runs. In batch mode, you must also disable the setting  Ignore layout and source export in batch mode  on the Misc tab in the Setup Preferences dialog box (SetupPreferences) when doing layout or schematic export.");
MGCAddSnippet(48, "You can use the open design in a layout or schematic viewer as input for your Calibre run; this is referred to as layout and schematic export. Layout and schematic export can also be used in a batch mode Calibre Interactive run with an additional setting. ");
MGCAddSnippet(49, "There are several methods for populating the fields in the Calibre Interactive GUI. ");
MGCAddSnippet(50, "The settings in the Calibre Interactive GUI can come from several sources, including direct user input, a Calibre Interactive runset, template settings, and the Customization GUI.");
MGCAddSnippet(51, "You can instruct Calibre Interactive to automatically load a rule file. The rule file is loaded when a runset is loaded and reloaded at runtime if the rule has been modified. You can choose whether or not to have a confirmation prompt displayed when the rule is about to be loaded.");
MGCAddSnippet(52, "The settings present in the Calibre Interactive GUI at the time of the run always take precedence over rule file settings if there is a conflict. This behavior allows you to customize your Calibre Interactive run without editing the rule file. However, in some cases you may want to insure that rule file settings are used for the run, or disable changes in portions of the Calibre Interactive GUI. Several features are available to manage requirements like this.");
MGCAddSnippet(53, "You can specify the options that Calibre uses when reading in OpenAccess and LEF/DEF databases. ");
MGCAddSnippet(54, "You can specify database read options for third party databases with the environment variable MGC_CALIBRE_DB_READ_OPTIONS. The options apply to OpenAccess input for all Calibre Interactive applications, and to LEF/DEF input for all applications except PEX. ");
MGCAddSnippet(55, "You can control database conversion options for third party databases using Calibre Interactive. These options apply to OpenAccess input for all Calibre Interactive applications, and to LEF⁄DEF input for all applications except PEX (parasitic extraction). ");
MGCAddSnippet(56, "This example describes how to specify the layer map, cell map, and object map files in Calibre Interactive when using OpenAccess as the Layout System. ");
MGCAddSnippet(57, "You provide LEF/DEF input on the Inputs pane Layout tab in Calibre Interactive. You can provide LEF/DEF input as database files, or export a DEF file from an open design tool. ");
MGCAddSnippet(58, "You can read LEF/DEF input from design files using Calibre Interactive. ");
MGCAddSnippet(59, "If your design tool is connected to Calibre Interactive and is capable of exporting the layout in DEF format, you can export the currently open design to Calibre. ");
MGCAddSnippet(60, "You provide OpenAccess database input in the Layout tab on the Inputs pane in Calibre Interactive. You specify database conversion options on the Options pane in the DatabaseOpenAccess/LEFDEF sub-tab. ");
MGCAddSnippet(61, "You can set options relating to the input databases using Calibre Interactive. You can also specify a Layout Text file and specify additional rules files and rule file statements. The method to set these options is similar in all Calibre Interactive applications. ");
MGCAddSnippet(62, "You can specify a Layout Text File in Calibre Interactive. The Layout Text File is used to specify free-standing cell-based text in the rule file. ");
MGCAddSnippet(63, "You can specify the SVRF Precision and Resolution statements in the Calibre Interactive control file. ");
MGCAddSnippet(64, "You can set several Calibre Interactive options that affect how your OpenAccess or LEF/DEF design is read. ");
MGCAddSnippet(65, "You can specify additional rule files and SVRF commands using the Calibre Interactive GUI. This allows you to make adjustments to the run without editing your rule file. ");
MGCAddSnippet(66, "Calibre Interactive enables you to choose whether to read net names when loading LEF/DEF or OpenAccess layout databases. By default, net names are not annotated when reading these databases.");
MGCAddSnippet(67, "Using the virtual net connections options, you can instruct Calibre to treat multiple, physically-disjoint layout net segments as if they were actually connected.");
MGCAddSnippet(68, "This section describes how to set up and run Calibre using Calibre Interactive. ");
MGCAddSnippet(69, "Use these general steps to set up and run a Calibre job for any of the supported applications.");
MGCAddSnippet(70, "You display the Transcript pane by clicking the Transcript button on the left panel of Calibre Interactive. The Transcript pane displays the Calibre transcript (also known as the log), which provides valuable information about your Calibre run.");
MGCAddSnippet(71, "The Calibre Quality Agent dialog box is displayed when Calibre Interactive encounters an application error. You use the dialog box to send feedback about the error conditions to the Calibre team. ");
MGCAddSnippet(72, "You can run Calibre Interactive in batch mode without opening the GUI. This mode of operation preserves the important features of Calibre Interactive, such as runsets, customization files, and export from layout, while letting you run in batch mode. ");
MGCAddSnippet(73, "You can run Calibre Interactive in batch mode without opening the GUI. All Calibre Interactive options are set in the runset. ");
MGCAddSnippet(74, "The method for selecting checks in a Calibre Interactive batch run depends on whether you are running Calibre Interactive nmDRC, Calibre Interactive DFM, or Calibre Interactive nmLVS.");
MGCAddSnippet(75, "The Check Selection Recipe is the preferred method for selecting the rule checks that are evaluated in a Calibre Interactive nmDRC or Calibre Interactive DFM batch run, just as for interactive GUI operation. The Check Selection Recipe is included in the runset specified for the batch run. The default check recipe is  Checks selected in the rules file . ");
MGCAddSnippet(76, "ERC checks in batch mode for Calibre Interactive nmLVS are selected using a customization file. ");
MGCAddSnippet(77, "You can export the design from an open design tool for use as input for the Calibre Interactive batch run. ");
MGCAddSnippet(78, "You specify a TVF rule file in Calibre Interactive on the Rules pane just as you do for an SVRF rule file. Some additional options are available when running with a TVF rule file. Debugging methods can be slightly different with a TVF rule file. ");
MGCAddSnippet(79, "The method for the checks that are executed in a Calibre Interactive run depends on which application you are running. ");
MGCAddSnippet(80, "The Check Selection Recipe specifies the checks that are executed during a Calibre Interactive nmDRC or Calibre Interactive DFM run. The Check Selection Recipe is specified on the Rules pane. ");
MGCAddSnippet(81, "A Check Selection Recipe is a set of expressions for selecting the checks to execute during a Calibre run. You can use built-in check recipes or create user-defined check recipes tailored for specific cases. Check Selection Recipes are used in Calibre Interactive nmDRC and Calibre Interactive DFM. The recipes are saved to the runset. ");
MGCAddSnippet(82, "The Check Selection Recipe specifies the checks that are executed in a Calibre Interactive nmDRC or DFM run. You can use a built-in check recipe or define your check recipe.");
MGCAddSnippet(83, "You can create a new custom check recipe or copy an existing recipe from the Check Selection Recipe Editor dialog box. Custom check recipes (also called user recipes) allow you to control which Calibre rule checks are executed during a Calibre nmDRC or Calibre DFM run. Check recipe definitions are saved in the Calibre Interactive runset, along with the currently active check recipe. ");
MGCAddSnippet(84, "The basic editing controls allow you to construct check recipes based on a short list of common expressions, such as  Checks selected in the rule file  and  Checks with density . You can also include and exclude individual checks and check groups. ");
MGCAddSnippet(85, "The advanced editing controls in the Recipe Editor allow you to select checks by layer and group, apply a wildcard filter, and select and unselect individual rule checks. ");
MGCAddSnippet(86, "You can subtract the check expression  Checks not selected in the rules file  from a custom check recipe in order to run only checks that are selected in the rule file. This step is necessary because most check expressions do not obey DRC [Un]Select Check and DFM [Un]Select Check statements in the rule file. ");
MGCAddSnippet(87, "The Check Selection Recipe Editor dialog box includes controls to create, copy, save, and edit a check selection recipe. Basic and advanced editing controls are available. ");
MGCAddSnippet(88, "The ERC rule checks that are executed during the Calibre run are selected with the Select Checks dialog box in Calibre Interactive nmLVS. You can also use a customization file to select checks.");
MGCAddSnippet(89, "The Calibre Interactive text editor lets you view and edit text files without leaving the application. Most of the files you use with Calibre Interactive are text files; these include control files, runsets, rule files, transcripts, and summary reports.");
MGCAddSnippet(90, "The layer derivation tree displays the layers found in the rule file and the sequence of derivations that lead up to a particular derived layer. The layer derivation tree also displays the checks and device definitions found in the rule file and the corresponding layer derivations. The layer derivation tree is available for all Calibre Interactive applications.");
MGCAddSnippet(91, "Calibre Interactive allows you to quickly view and edit environment variables relevant to your design. The environment variables referenced in your rule file are automatically listed in the Set Environment Variables dialog box. In addition to viewing rule file environment variables, you can view the environment variables defined in the shell session and create and edit runset environment variables. ");
MGCAddSnippet(92, "The Set Environment Variables dialog box allows you to view shell, runset, and rule file environment variables. You can add and edit runset variables, which are variables defined for the Calibre Interactive session and saved in the runset. ");
MGCAddSnippet(93, "There are several methods for creating and modifying environment variables in Calibre Interactive. The rule file, shell environment, and GUI setup for the examples is explained first. ");
MGCAddSnippet(94, "The examples for using environment variables all use the same rule file and shell environment setup.");
MGCAddSnippet(95, "You can add an environment variable to your runset and set the value using the Set Environment Variables dialog box. Runset variables added in this way can be used in any of the Calibre Interactive GUI fields that accept environment variables. ");
MGCAddSnippet(96, "You can change the value of an environment variable by editing it in the Runset Value column of the Set Env. tab in the Set Environment Variables dialog box. This applies to both rule file and runset environment variables. If you want to use the new value in the Calibre Interactive session, you must make sure that the Runset column has a green box with a check mark to indicate that the runset value is used.");
MGCAddSnippet(97, "You can change the value used for a shell environment variable by assigning it a runset value and specifying that the runset value be used during the Calibre Interactive session. ");
MGCAddSnippet(98, "You can control many behaviors of the Calibre Interactive GUI with setup preferences. Setup preferences are specified with the Setup Preferences dialog box, which is opened by selecting SetupPreferences. Startup Preferences are saved automatically to special setup files, while all other preferences are saved to the runset. ");
MGCAddSnippet(99, "Most Setup Preferences are saved to the Calibre Interactive runset, while Startup Preferences are automatically saved to special configuration files. ");
MGCAddSnippet(100, "You define startup preferences from the Startup tab in the Setup Preferences dialog box, which is opened by selecting the SetupPreferences menu item. The startup preferences define startup behavior for loading runsets, optional customization file settings, and the Calibre Interactive window position. Startup preferences are saved in special configuration files. ");
MGCAddSnippet(101, "The Startup tab in the Setup Preferences dialog box defines startup behavior for loading runsets, optional customization file settings, and the Calibre Interactive window position. For Calibre Interactive nmDRC and DFM, it also includes settings for imported check recipes files.");
MGCAddSnippet(102, "Calibre Interactive automatically saves your startup preferences to special setup files, stored in your $HOME directory by default. Separate setup files allow you to define different startup preferences for the different Calibre Interactive applications. ");
MGCAddSnippet(103, "You can use file naming templates to form the names that Calibre Interactive generates. The template preference settings are applied when you invoke Calibre Interactive from a layout or schematic editor. Template settings make use of the cell and view open in the design tool to name input and output files. You define file naming templates on the Templates tab of the Setup Preferences dialog box (SetupPreferences).");
MGCAddSnippet(104, "You can use a template definition to create an output file name based on the top cell in the design. The method for doing this is shown in an example and with a short video. ");
MGCAddSnippet(105, "You may sometimes see that saved runset settings are not used when you open Calibre Interactive from a design tool. This occurs because templates are used to fill in certain GUI fields based on the open design when you launch Calibre Interactive from a design tool. You can disable templates if you want to use only saved runset options. You can disable all templates or delete the template for a specific GUI field. ");
MGCAddSnippet(106, "If Calibre Interactive is connected to a layout or schematic viewer, you have the option of specifying the open layout or netlist as the input file for the run; this is called layout or schematic export. You can set a preference for the export setting that is used when Calibre Interactive is invoked from a layout or schematic viewer. The preference setting is on the TemplatesInputs sub-tab of the Setup Preferences dialog box. This preference setting is not used in batch mode or command line execution.");
MGCAddSnippet(107, "You can disable several Calibre Interactive options and changes to certain settings on the Disable tab on the Setup Preferences dialog box (SetupPreferences).");
MGCAddSnippet(108, "The preferences on the Misc tab of the Setup Preferences dialog box in Calibre Interactive control warnings and prompts, automatic behaviors, and other options. ");
MGCAddSnippet(109, "The Calibre Interactive nmDRC Graphical User Interface (GUI) is an interface to Calibre nmDRC. The Calibre Interactive - nmDRC window allows you to specify command line options and select rule file statements that guide Calibre nmDRC. ");
MGCAddSnippet(110, "The most common scenario for performing DRC from Calibre Interactive assumes that a runset containing all the necessary settings already exists. Your time is spent running DRC and correcting errors in an interactive verification loop. ");
MGCAddSnippet(111, "Several requirements must be met before running Calibre Interactive nmDRC. ");
MGCAddSnippet(112, "In general, it is best to begin setup for a DRC run in the Rules pane. Once you define a rule file, you have the option to use it to populate the other rule-file related fields. Calibre Interactive interprets any relative pathnames as relative to the run directory, which you define on this pane.");
MGCAddSnippet(113, "The Check Selection Recipe specifies the checks that are executed in a Calibre Interactive nmDRC run. You can use a built-in check recipe or define your own check recipe. ");
MGCAddSnippet(114, "The run type for a Calibre nmDRC run determines whether Calibre is run in hierarchical or flat mode, as a FastXOR run for Layout versus Layout comparison, or in Autowaiver Creation mode.");
MGCAddSnippet(115, "Layout input for a Calibre Interactive nmDRC run can be exported from an open design tool or read from file. You can also specify multiple layout inputs. ");
MGCAddSnippet(116, "You can use the open cell in a your design tool as the layout input for a Calibre Interactive nmDRC run. Enable  Export from layout viewer  on the Inputs pane to use this mode.");
MGCAddSnippet(117, "Calibre Interactive can read layout input from database files. Uncheck  Export from layout viewer  on the Inputs pane to use this mode.");
MGCAddSnippet(118, "If your primary cell has references to other additional database files you may need to load multiple layouts. You specify multiple layouts using the DRC Options pane in the DatabaseLibrary sub-tab.");
MGCAddSnippet(119, "Calibre Auto-Waivers allows you to waive certain results and run Calibre nmDRC with these waivers taken into account. The waiver_flow executable is used to generate waiver shapes and can be run from Calibre Interactive. ");
MGCAddSnippet(120, "You specify the results database and format on the Outputs pane. You can also select to have Calibre RVE open automatically and choose side RDBs to view. In addition, you can create a DRC HTML Report and a CTO file. ");
MGCAddSnippet(121, "Use the following procedure to start a Calibre nmDRC run from Calibre Interactive—nmDRC.");
MGCAddSnippet(122, "You can control how your Calibre nmDRC job is run by configuring options related to performance, remote and distributed computing, and license acquisition. The controls are on the Run Control pane. ");
MGCAddSnippet(123, "Calibre Interactive provides access to a wide range of Calibre nmDRC options. Some are available in the Setup menu, others from the Inputs and Outputs panes, and others are available through the DRC Options pane. ");
MGCAddSnippet(124, "When performing hierarchical DRC, Calibre may expand certain cells for improved performance. The process of expanding a cell removes one level of hierarchy by promoting it into the parent cell. If a DRC error occurs in a cell that gets expanded, it is reported in the parent cell. ");
MGCAddSnippet(125, "Use this option to control the number of results reported for each DRC rule check.");
MGCAddSnippet(126, "Rule check text consists of rule file comments and rule file information, such as the rule file title and pathname. You can use Calibre Interactive to specify the amount of check text written to the ASCII results database.");
MGCAddSnippet(127, "You can choose to report DRC results in local cell coordinates or top cell space. By default Calibre Interactive nmDRC reports errors in local cell space. This option is for Calibre nmDRC‑H only.");
MGCAddSnippet(128, "Calibre Interactive—nmDRC can create a Check Text Override file to control layer visibility for highlight actions and to define categories for filtering by category. The CTO file is used by Calibre RVE for DRC and DRC HTML reporting. The automatically generated CTO file causes only the layers used in the rule check to be displayed when highlighting a result. Category definitions are optional.");
MGCAddSnippet(129, "You can specify to have Calibre Interactive nmDRC automatically create a DRC HTML Report after the Calibre run is finished. You can use a pre-defined configuration file or specify your own configuration file for the report format. Highlight images are automatically included. A shell script is created so that you can run the report at a later time from the command line. ");
MGCAddSnippet(130, "You can specify the statement DFM Defaults RDB {GDS | OASIS} using Calibre Interactive nmDRC. The setting is on the DRC Options pane on the DatabaseDFM Defaults sub-tab. You can set default options for the RDB filename, format, cell name prefix and suffix, and the TOP keyword. ");
MGCAddSnippet(131, "You can run DRC checks on only a specified rectangular area of the layout. Area DRC checks the specified area plus a halo region around the area. You can specify the halo size and whether results in the halo region are filtered out or kept.");
MGCAddSnippet(132, "You can perform a Calibre FastXOR layout comparison using Calibre Interactive. ");
MGCAddSnippet(133, "Calibre FastXOR is targeted for comparison between design iterations and can complete XOR comparison many times faster than traditional XOR flows. Calibre FastXOR uses pre-processing by DBdiff to analyze two layout databases to determine the objects that differ between the two databases. Then, Calibre nmDRC‑H is used to perform XOR operations on just the objects and layers that differ as determined by DBdiff. ");
MGCAddSnippet(134, "The Rule File Generation tab for FastXOR allows you to specify output file and DBdiff options when the FastXOR rule file is created by Calibre Interactive.");
MGCAddSnippet(135, "The Fast XOR Options tab includes settings for the report file, RDB file, template file, and other options for a FastXOR run in Calibre Interactive. ");
MGCAddSnippet(136, "When verifying a design, some rule check violations may be waived by the foundry. A waived result is a violation that is considered acceptable for the design and process. Designers often want to eliminate waived errors from their Calibre results so they can focus on the errors that need to be fixed. You can perform many of the tasks related to Calibre Auto-Waivers using Calibre Interactive. ");
MGCAddSnippet(137, "Calibre Auto-Waivers automates the process of applying waivers during design verification. ");
MGCAddSnippet(138, "In addition to the standard requirements for the Calibre application, there are additional licensing, rule file, and input file requirements when running Calibre Auto-Waivers with Calibre Interactive.");
MGCAddSnippet(139, "Calibre Auto-Waivers can be used with Calibre Interactive and Calibre RVE. You can generate waivers, set many options, and start a waiver run. ");
MGCAddSnippet(140, "You can use Calibre Interactive to generate a waiver shape database for the Calibre Auto-Waivers flow. All the waiver setup parameters are controlled through Calibre Interactive, then the waiver_flow tool is used to create the waiver database. The waiver cells file defines the cells from which waivers are generated and the rule checks to waive.");
MGCAddSnippet(141, "You can use Calibre Interactive to start a Calibre verification run with Calibre Auto-Waivers. The waiver setup parameters are specified on the Waivers tab of the Inputs pane. The waiver run adds the  ‑waiver  option to the Calibre command line. ");
MGCAddSnippet(142, "You can use Calibre Interactive to run Calibre DFM and Calibre LFD. ");
MGCAddSnippet(143, "The Calibre Interactive DFM Graphical User Interface (GUI) is an interface to Calibre DFM. The Calibre Interactive - DFM window allows you to specify command line options and select rule file statements that guide Calibre DFM.");
MGCAddSnippet(144, "In general, it is best to begin setup for a DFM run in the Rules pane. After you define a rule file, you can load the rule file to populate other GUI fields with rule file settings. Calibre Interactive interprets any relative pathnames as relative to the run directory, which you define on this pane.");
MGCAddSnippet(145, "The Check Selection Recipe specifies the checks that are executed in a Calibre Interactive DFM run. You can use a built-in check recipe or define your own check recipe. ");
MGCAddSnippet(146, "The run mode in Calibre Interactive DFM determines whether you run Critical Area Analysis (CAA), Critical Feature Analysis (CFA), the CMP Analyzer, or Litho Friendly Design (LFD). ");
MGCAddSnippet(147, "Layout input for a Calibre Interactive DFM run can be exported from an open design tool or read from file. You can also specify multiple layout inputs. ");
MGCAddSnippet(148, "You can use the open cell in a your design tool as the layout input for a Calibre Interactive DFM run. Enable  Export from layout viewer  on the Inputs pane to use this mode.");
MGCAddSnippet(149, "Calibre Interactive can read layout input from database files. Uncheck  Export from layout viewer  on the Inputs pane to use this mode.");
MGCAddSnippet(150, "If your primary cell has references to other additional database files you may need to load multiple layouts. You can specify multiple layouts on the Database > Library tab of the DFM Options pane.");
MGCAddSnippet(151, "Calibre Auto-Waivers with Critical Feature Analysis allows you to waive certain results and run Calibre DFM with these waivers taken into account. The waiver_flow executable is used to generate waiver shapes, and can also be run from Calibre Interactive - DFM when you are performing Critical Feature Analysis (CFA). ");
MGCAddSnippet(152, "You specify the format of the output database on the Outputs pane of Calibre Interactive DFM. You can specify options for a DFM database on the DFMDB tab of the DFM Options pane. ");
MGCAddSnippet(153, "You specify the format of the output database on the Outputs pane of Calibre Interactive DFM. ");
MGCAddSnippet(154, "If you are performing a run that generates a DFM Database, you can specify which layers you would like saved to a DFM Database. ");
MGCAddSnippet(155, "You can run a YieldServer script on DFM database after it is created.");
MGCAddSnippet(156, "You can control how your Calibre DFM job is run by configuring options related to performance, remote and distributed computing, and license acquisition. ");
MGCAddSnippet(157, "Calibre Interactive provides access to a wide range of Calibre DFM options. Some are available in the Setup menu, others are available through the DFM Options pane, which you access by clicking the DFM Options button on the left panel. ");
MGCAddSnippet(158, "You can control the number of results reported for each DFM rule check. This reporting option is only applicable to ASCII RDB output.");
MGCAddSnippet(159, "You can specify options for the DFM Database on the DFMDB tab of the DFM Options pane.");
MGCAddSnippet(160, "Calibre reports DFM results in top-cell coordinates by default. Choose the  Output cell errors in cell space  option to instruct Calibre to use local cell space coordinates when reporting errors. This option is only for DFM-H runs that output ASCII format results database.");
MGCAddSnippet(161, "You can run Calibre DFM on only a specified rectangular area of the layout. Area DFM runs on the specified area plus a halo region around the area. You can specify the halo size and whether results in the halo region are filtered out or kept.");
MGCAddSnippet(162, "The Calibre Interactive nmLVS GUI allows you to specify command line options and select rule file statements for a Calibre nmLVS run. You can save GUI settings to a Calibre Interactive runset and load them in future runs. ");
MGCAddSnippet(163, "The Calibre Interactive nmLVS Graphical User Interface (GUI) is an interface to Calibre nmLVS. The Calibre Interactive - nmLVS window allows you to specify command line options and selected rule file statements that guide Calibre nmLVS.");
MGCAddSnippet(164, "You need to specify a rule file for any Calibre nmLVS run. You specify the rule file on the Rules tab of Calibre Interactive. You can click the Load button to load the rule file settings into the GUI fields. ");
MGCAddSnippet(165, "You specify the type of Calibre nmLVS run on the Inputs pane.");
MGCAddSnippet(166, "You specify input data and other input-related options in separate tabs on the Inputs pane. ");
MGCAddSnippet(167, "Layout data for a Calibre Interactive nmLVS run is specified on the Inputs pane in the Layout tab. The input data and options you specify depend on the analysis type and whether you are reading layout data from file or exporting it from an open design tool. Depending on the format of the layout input, you can specify multiple layouts and other options. ");
MGCAddSnippet(168, "Layout data for a Calibre Interactive nmLVS run is specified on the Inputs pane on the Layout tab. You can export the layout from an open design tool. Geometric layout data is used in Layout vs Netlist and Netlist Extraction runs. The layout netlist is extracted from the geometric layout. ");
MGCAddSnippet(169, "Layout data for a Calibre Interactive nmLVS run is specified on the Inputs pane on the Layout tab. You can read the layout data file design files saved on disk. Geometric layout data is used in Layout vs Netlist and Netlist Extraction runs. The layout netlist is extracted from the geometric layout. ");
MGCAddSnippet(170, "If your primary cell has references to other additional database files you may need to load multiple layouts. You can specify multiple layouts using the Database > Library tab on the LVS Options pane.");
MGCAddSnippet(171, "Layout netlist data for a Calibre Interactive nmLVS run is specified on the Inputs pane on the Layout tab. You can export the layout netlist from an open design tool. The layout netlist is used in Netlist vs Netlist runs. ");
MGCAddSnippet(172, "Layout netlist data for a Calibre Interactive nmLVS run is specified on the Inputs pane on the Layout tab. You can read the layout netlist from an existing file. The layout netlist is used in Netlist vs Netlist runs. ");
MGCAddSnippet(173, "Calibre nmLVS comparison runs require a source (or schematic) netlist. Source data can be exported from an connected schematic viewer or exist in database files. Netlist extraction runs do not use a source netlist.");
MGCAddSnippet(174, "You can read source netlist data from a connected schematic viewer. A source netlist is required in Layout vs Netlist and Netlist vs Netlist runs in Calibre Interactive nmLVS. ");
MGCAddSnippet(175, "You can read source netlist data from file. A source netlist is required in Layout vs Netlist and Netlist vs Netlist runs in Calibre Interactive nmLVS. ");
MGCAddSnippet(176, "You can specify Verilog netlists as input source netlists for your Calibre nmLVS run. The Verilog netlist is translated into an LVS SPICE netlist before Calibre nmLVS is run using the v2lvs translator provided in the Calibre software tree.");
MGCAddSnippet(177, "You specify additional SPICE netlist files on the DatabaseLibrary sub-tab of the LVS Options pane. This may be needed to provide INCLUDE files for the main source netlist. This option is also available for Calibre Interactive PERC and Calibre Interactive PEX. ");
MGCAddSnippet(178, "Hcell files are used in hierarchical Calibre nmLVS to define the correspondence between layout and source cell names. ");
MGCAddSnippet(179, "You can use Calibre Interactive nmLVS to calculate the effectiveness of hcells in reducing the total hierarchical instance count of your design. You can also extract and view the hierarchical structure of the design. ");
MGCAddSnippet(180, "A number of options affect the output of your hcell analysis. ");
MGCAddSnippet(181, "Hcell analysis results are shown in four sub-tabs within the H-Cells tab of the Calibre Interactive nmLVS Inputs pane. ");
MGCAddSnippet(182, "You can specify the ERC rule checks to waive and the cells in which the waivers apply using the Calibre Auto-Waivers flow. ");
MGCAddSnippet(183, "The Outputs pane in Calibre Interactive nmLVS specifies the LVS report file, the SVDB (Standard Verification Database), and its options. ");
MGCAddSnippet(184, "Use the following procedure to start a Calibre nmLVS run from Calibre Interactive—nmLVS.");
MGCAddSnippet(185, "You can control how your Calibre nmLVS job is run by configuring options related to performance, remote and distributed computing, and license acquisition. ");
MGCAddSnippet(186, "You can specify options for your Calibre nmLVS run from the LVS Options pane. These settings generate SVRF specification statements in your control file. The options you specify in the GUI override the rule file settings. ");
MGCAddSnippet(187, "You use the Supply tab to specify power and ground net names and to choose related options.");
MGCAddSnippet(188, "If you use Sconnect statements in your rule file and encounter errors during your run, you can have Calibre nmLVS abort automatically on soft connection conflicts.");
MGCAddSnippet(189, "Choose this option to disable the use of cell ports as initial correspondence points for connectivity comparison.");
MGCAddSnippet(190, "You can adjust the information included in the LVS Report file. The settings on the Report tab are all optional, and in most cases the default settings are adequate. ");
MGCAddSnippet(191, "You can specify to report seed promotions during your Calibre nmLVS run. The Seed Promotions Report provides detailed information regarding the promotion of individual polygons to higher-level cells for the purpose of device recognition. This is an advanced option for Calibre nmLVS-H and may increase run time. It should be used for test purposes only.");
MGCAddSnippet(192, "These options control how Calibre performs logic gate recognition.");
MGCAddSnippet(193, "These options control how split gates are reduced.");
MGCAddSnippet(194, "You can filter out specific unused devices in your layout and source using the Filter Unused Device Options table in the Gates tab of the LVS Options pane. ");
MGCAddSnippet(195, "You can use the Properties tab on the Options pane in Calibre Interactive to override the Trace Property statements in your rule file. You can add new statements, edit existing statements, and disable statements. This feature is available in Calibre Interactive nmLVS, Calibre Interactive PERC, and Calibre Interactive PEX.");
MGCAddSnippet(196, "You can use Calibre Interactive to override the LVS Box related statements in your rule file; this is done on the LVS Box tab on the LVS Options pane. You can add new statements, edit existing statements, and disable statements. This feature is available in Calibre Interactive nmLVS, Calibre Interactive PERC, and Calibre Interactive PEX. ");
MGCAddSnippet(197, "Calibre has a short isolation feature to help pinpoint the location of layout shorts between texted nets. You can specify this option in Calibre Interactive.");
MGCAddSnippet(198, "You can use Calibre Interactive nmLVS to set up the run so that you can view the results in Calibre RVE for LVS. Certain settings are needed to enable various debug features.");
MGCAddSnippet(199, "Calibre can execute Electrical Rule Check (ERC) statements during a Calibre nmLVS run.");
MGCAddSnippet(200, "You use the Select Checks dialog box to specify which ERC checks to execute during your Calibre nmLVS run. You can also choose whether to abort an Calibre nmLVS run if an ERC check fails. Selections in the Select Checks dialog box are not saved to the runset and must be reset each time you open Calibre Interactive nmLVS. ");
MGCAddSnippet(201, "Calibre Interactive nmLVS allows you to easily generate unique signature strings for devices. Device signatures enable the matching of devices in the layout to a specific geometric pattern, rather than matching to just the layers present. ");
MGCAddSnippet(202, "You can use Calibre Interactive nmLVS to create a device signature file. Device signatures enable the matching of devices in the layout to a specific geometric pattern, rather than matching to just the layers present. The signature creation process from the GUI is a standalone step, separate from your LVS comparison or netlist extraction run. You can save the device commands with the generated device signatures to a new file or append to an existing file. An Include statement is typically used to include the Device statements with signatures in the rule file for your Calibre nmLVS run.");
MGCAddSnippet(203, "The Layers File is used to define the device types, device layers, pin names and pin layers for signature creation. The entries in the Layers File populate the fields of the Edit Parameters for Device dialog box in Calibre Interactive. You create the Layers File with a text editor.");
MGCAddSnippet(204, "Use the Edit Parameters dialog box to specify the layers, pin names, and options used for device signature creation in Calibre Interactive.");
MGCAddSnippet(205, "You can use Calibre Interactive to run Calibre parasitic extraction. ");
MGCAddSnippet(206, "The Calibre Interactive PEX Graphical User Interface (GUI) is an interface to the Calibre xRC, Calibre xACT, and Calibre xACT 3D batch parasitic extraction tools. The Calibre Interactive PEX GUI allows you to specify command line options and selected rule file statements that execute the desired Calibre PEX application.");
MGCAddSnippet(207, "You need to specify a rule file for any PEX run. You can specify a rule file automatically with a runset or you can specify one manually using this procedure.");
MGCAddSnippet(208, "The Inputs pane includes the tabs for each type of input. Use these tabs to specify the inputs needed for your PEX run.");
MGCAddSnippet(209, "A layout database is required for PEX runs. The source of your layout data can vary depending on whether your Calibre Interactive session is connected to a viewer or not.");
MGCAddSnippet(210, "If your primary cell has references to other additional database files you may need to load multiple layouts. You can specify multiple layouts on the DatabaseLibrary sub-tab of the PEX Options pane (SetupPEX Options).");
MGCAddSnippet(211, "Schematic netlist input is optional for a PEX run. A schematic netlist is needed if you want to use source schematic names instead of layout names in the extracted netlist. Also see the  Use Names From  setting on the Outputs pane.");
MGCAddSnippet(212, "The hcell list specifies the correspondence between layout and source cell names for hierarchical Calibre nmLVS operations. The xcell list is used during parasitic extraction and defines the cells that are preserved during extraction.");
MGCAddSnippet(213, "The Blocks tab on the Inputs pane displays an alphabetical list of cells found in the netlist files specified in the Netlist tab. Each cell entry contains an expansion control and the number of placements of each subcell found within its parent cell. ");
MGCAddSnippet(214, "You can specify probe points in your parasitic model using Calibre Interactive. Probe points are used to verify timing from specific points on each net.");
MGCAddSnippet(215, "The Outputs pane in Calibre Interactive PEX specifies the extraction mode and level and options for the extracted netlist, reports, and output database options. ");
MGCAddSnippet(216, "The Outputs pane in Calibre Interactive PEX specifies the extraction mode and level.");
MGCAddSnippet(217, "The Netlist and Nets tabs on the Outputs pane specify the netlist format and which nets to extract parasitics for. ");
MGCAddSnippet(218, "You select report options on the Reports tab on the Outputs pane.");
MGCAddSnippet(219, "You specify that results database name and options on the Outputs tab of the Outputs pane. ");
MGCAddSnippet(220, "You can use a file naming template to name the extracted parasitic netlist based on the cell, extraction type, netlist format, and format options. For example, if the netlist format is DSPF, the file extension can be set to .dspf. ");
MGCAddSnippet(221, "You click Run PEX to start your parasitic extraction run in Calibre Interactive PEX. You can run each step in the parasitic extraction process separately. ");
MGCAddSnippet(222, "Use the following procedure to start a parasitic extraction run from Calibre Interactive—PEX.");
MGCAddSnippet(223, "By default, the GUI executes all three PEX steps (Persistent Hierarchical Database creation, Parasitic Database creation and formatted pex netlist creation) each time you click Run PEX. You can select each step individually, if desired.");
MGCAddSnippet(224, "You can control how your Calibre PEX job is run by configuring options related to performance, remote and distributed computing, and license acquisition. ");
MGCAddSnippet(225, "You can customize the extracted parasitic netlist by selecting appropriate options in Calibre Interactive. The settings in Calibre Interactive override rule file settings and defaults for the parasitic extraction run. Most option settings are on the PEX Options pane, while some are on the Outputs pane. ");
MGCAddSnippet(226, "By default, Calibre extracts parasitics from all nets in your layout. You can include or exclude certain nets from extraction.");
MGCAddSnippet(227, "The netlist formatting options specify how the netlist is constructed. ");
MGCAddSnippet(228, "The netlist reduction and coupling capacitance options provide additional control over the extracted parasitic netlist.");
MGCAddSnippet(229, "The advanced controls for the extracted parasitic netlist include options specific to the output netlist format.");
MGCAddSnippet(230, "You can use the NetlistVias tab on the PEX Options pane to override the PEX Reduce Via Resistance statements in your rule file or add new statements. ");
MGCAddSnippet(231, "You can specify the pin ordering for the netlist. ");
MGCAddSnippet(232, "By default, Calibre xRC includes both extracted resistors and capacitors in the extracted parasitic netlist for RC and RCC runs. You can limit the extracted parasitic netlist to just extracted capacitors or just extracted resistors.");
MGCAddSnippet(233, "You can specify layer-specific parameters for resistance calculations in Calibre Interactive PEX. ");
MGCAddSnippet(234, "You can specify non-default temperature parameters for resistance calculations. ");
MGCAddSnippet(235, "You can choose to simplify the backannotation of net geometries into Calibre View by selecting the  Net Geometry  option for Calibre View and the  Show Parasitic Polygons  option in the Calibre View setup.");
MGCAddSnippet(236, "You can add the PRIMETIME keyword to your Pex Netlist statement if you are using either the SPEF or DSPF netlist formats in RC mode. The optional keyword PRIMETIME creates a more compact netlist that the PrimeTime static timing analysis tool can parse. ");
MGCAddSnippet(237, "You can configure the PEX Power and PEX Ground statements for specific nets using Calibre Interactive PEX. ");
MGCAddSnippet(238, "You can use Calibre PEX to create a driver/receiver file for use during parasitic extraction.");
MGCAddSnippet(239, "You can specify the instance prefix used by your netlist file. ");
MGCAddSnippet(240, "You can control inductance extraction using Calibre Interactive.");
MGCAddSnippet(241, "You can configure the delay calculation tool that runs on blocks marked for extraction.");
MGCAddSnippet(242, "You can control the level of output to the transcript for the PDB and formatter execution stages.");
MGCAddSnippet(243, "You can use the Properties tab on the PEX Options pane in Calibre Interactive to override the Trace Property statements in your rule file. You can add new statements, edit existing statements, and disable statements. ");
MGCAddSnippet(244, "You can set options for gate recognition, gate reduction, and netlist extraction in a Calibre Interactive PEX run. ");
MGCAddSnippet(245, "You can specify LVS power and ground names and LVS report options on the LVS Options tab of the PEX Options pane.");
MGCAddSnippet(246, "You can control how Calibre performs logic gate recognition. ");
MGCAddSnippet(247, "You can control how split gates are reduced using Calibre Interactive PEX. ");
MGCAddSnippet(248, "You can filter out specific unused devices in your layout and source using Calibre Interactive PEX. ");
MGCAddSnippet(249, "You can use Calibre Interactive to run the CalibrexACT direct netlisting flow. The GUI includes the following features:");
MGCAddSnippet(250, "Several requirements must be met to use Calibre Interactive xACT.");
MGCAddSnippet(251, "You invoke Calibre Interactive xACT from a design tool or from the command line. Calibre DESIGNrev and Cadence Virtuoso are supported. ");
MGCAddSnippet(252, "The Calibre Interactive xACT command line has options to run in interactive mode or batch mode. You can also specify one or more runsets to open. ");
MGCAddSnippet(253, "To set up the GUI for a run, click each of the page names on the left panel of the GUI and fill in the required fields. ");
MGCAddSnippet(254, "A search page, rule file loading, and other features make the Calibre Interactive xACT GUI easy to use. ");
MGCAddSnippet(255, "The environment variable MGC_CALIBRE_XACT_RUNSET_LIST populates the Load Runset Files dialog box and the recent files lists for runsets and text files. Used only in Calibre Interactive xACT. ");
MGCAddSnippet(256, "Calibre Interactive xACT can read in runsets created for Calibre Interactive PEX. Supported runset options are automatically converted. ");
MGCAddSnippet(257, "Calibre Interactive xACT can load a Tcl customization file that was developed for classic Calibre Interactive. A new Custom page is created within the GUI and the customization controls are placed on the Custom page. ");
MGCAddSnippet(258, "You provide OpenAccess database input on the Inputs page in Calibre Interactive xACT. You specify database conversion options on the OPENACCESS page. ");
MGCAddSnippet(259, "You can specify probe points in your parasitic model using Calibre Interactive. Probe points are used to verify timing from specific points on each net.");
MGCAddSnippet(260, "Most option settings in the Calibre Interactive xACT GUI are easy to use, especially with the help of tooltips and knowledge of the corresponding SVRF statements. The option settings that benefit from more explanation are described in this section. ");
MGCAddSnippet(261, "The connection to a design tool is made automatically when you invoke Calibre Interactive xACT from the design tool. You can also make the connection to the design tool manually after the GUI is invoked from the command line. ");
MGCAddSnippet(262, "You can use Calibre Interactive to override the LVS Box related statements in your rule file; this is done on the LVS page with the LVS Box, LVS Black Box Port, and LVS Black Box Port Depth options. You can add new statements, edit existing statements, and disable statements. ");
MGCAddSnippet(263, "The settings for a Calibre xACT run are made in several pages selected from the left panel of the GUI. ");
MGCAddSnippet(264, "The Outputs page controls the extraction mode and statements related to the extracted netlist and results database. ");
MGCAddSnippet(265, "You can adjust LVS-related settings on the LVS page. These include power and ground net names, gate recognition, device filtering, LVS Report options, and LVS Box settings. ");
MGCAddSnippet(266, "The Database page has settings for the precision, resolution, and additional layout and source files. ");
MGCAddSnippet(267, "You can control database conversion options for third party databases using Calibre Interactive xACT. ");
MGCAddSnippet(268, "The Environment page has controls to view and define environment variables for the Calibre Interactive xACT run. ");
MGCAddSnippet(269, "The Run Control Page in Calibre Interactive xACT has settings for the host processor and run options, connection to a design tool, and Calibre RVE invocation. ");
MGCAddSnippet(270, "The Triggers page defines trigger functions that execute before and after the batch Calibre run. Trigger functions can run in the shell environment or in the design tool environment. Trigger definitions are saved in the runset. You can also specify trigger functions in the custom configuration file. ");
MGCAddSnippet(271, "The Templates page has settings for file-naming templates, which form the names that Calibre Interactive generates. For example, you can specify input and output filenames based on the open cell in a connected design tool. ");
MGCAddSnippet(272, "The Search toolbar finds matches to a search string. The behavior depends on the GUI page that is active.");
MGCAddSnippet(273, "The Preferences page has settings for loading and saving the runset, saving the transcript, and loading a custom configuration file. ");
MGCAddSnippet(274, "The Rules preferences in Calibre Interactive xACT control behavior for reading, saving, and loading the rule file.");
MGCAddSnippet(275, "The runset preferences in Calibre Interactive xACT control runset open, close, and save behavior, and runset tagging information.");
MGCAddSnippet(276, "The miscellaneous (Misc) preferences in Calibre Interactive xACT control warnings and prompts, automatic behaviors, and other options.");
MGCAddSnippet(277, "You can customize the GUI by loading a configuration file. You can specify controls as hidden or not editable and define custom GUI panes. You can also specify #DEFINE and Variable statements that are added to the Calibre Interactive control file.");
MGCAddSnippet(278, "You can load a configuration file with a command line option, by specifying the configuration file with an environment variable, loading it from the GUI, or loading a runset with a configuration file specified. ");
MGCAddSnippet(279, "The configuration file in Calibre Interactive contains commands and specifications to customize the appearance of the GUI.");
MGCAddSnippet(280, "The configuration file specifies a custom GUI configuration. You can specify new pages, hide pages, control the visibility of options, and add controls for #DEFINE and Variable statements. You can also connect a function to a GUI action such as changing a value. ");
MGCAddSnippet(281, "Objects defined in the Configuration section of the Calibre Interactive xACT configuration file have a global scope. A global object is declared with the  property variant  keyword.");
MGCAddSnippet(282, "Arrays and key-value maps can be used in the Calibre Interactive xACT configuration file with some limitations. ");
MGCAddSnippet(283, "Certain properties apply at the tool level to set overall behavior and appearance of the Calibre Interactive xACT GUI. For example, you can specify the pages that are visible in the GUI. ");
MGCAddSnippet(284, "Certain option properties are common to the all Calibre Interactive xACT GUI objects. For example, you can specify the tooltip, label, visibility, and the page on which an option is displayed. The objects created by the configuration API commands also have some of the same option properties. ");
MGCAddSnippet(285, "You can connect functions to signals generated by the Calibre Interactive xACT GUI. Signals are generated when a property value changes and when a user-defined button is clicked. ");
MGCAddSnippet(286, "You can use the hyperlink option property to add a link to a custom control. The hyperlink property is supported for addHeader, addLabel, and the commands that add Variable, #DEFINE, and #UNDEFINE statements to the control file. ");
MGCAddSnippet(287, "The Calibre Interactive xACT configuration file uses the same option names as the runset file. You can determine option names by saving a runset in which only the options of interest have non-default settings. ");
MGCAddSnippet(288, "The configuration file in Calibre Interactive xACT supports many commands for GUI customization.");
MGCAddSnippet(289, "The Calibre Interactive xACT configuration file has functions to add and remove pages, write to the transcript, add a separator line, and add text to the GUI. With the exception of the transcript function, these functions do not affect the Calibre run. ");
MGCAddSnippet(290, "Adds a header label with a shaded background to the Calibre Interactive xACT GUI. ");
MGCAddSnippet(291, "Adds a text label to the Calibre Interactive xACT GUI. ");
MGCAddSnippet(292, "Specifies that the visibility of a control depends on the state of another control (the primary control) defined in the Calibre Interactive xACT configuration file. ");
MGCAddSnippet(293, "Specifies that the visibility of a control depends on the state of another control (the primary control) defined in the Calibre Interactive xACT configuration file. The dependent control is displayed if the primary control is not selected. ");
MGCAddSnippet(294, "Specifies that the visibility of a control depends on one or more other controls (the primary controls) that are defined in the Calibre Interactive xACT configuration file. The logic for displaying the dependent control is defined with an expression involving the primary controls. ");
MGCAddSnippet(295, "Specifies that the visibility of a control depends on one or more other controls (the primary controls) that are defined in the Calibre Interactive xACT configuration file. The logic for displaying the dependent control is determined by a function defined in the configuration file. ");
MGCAddSnippet(296, "Adds a custom page to the Calibre Interactive xACT GUI or changes the page order of an existing page. ");
MGCAddSnippet(297, "Adds a separator line with an optional text label to the Calibre Interactive xACT GUI. ");
MGCAddSnippet(298, "The tool.envVars object includes function calls to read and set environment variables from the Calibre Interactive xACT custom configuration file. ");
MGCAddSnippet(299, "The FileIO component and associated functions provide the means to perform file I/O with the Calibre Interactive xACT custom configuration file. ");
MGCAddSnippet(300, "Returns a string containing the Calibre version, for example v2017.3_0.74. ");
MGCAddSnippet(301, "Returns the process ID for the Calibre Interactive GUI. ");
MGCAddSnippet(302, "Returns a Boolean value indicating whether the specified option name exists. ");
MGCAddSnippet(303, "Removes a page from the Calibre Interactive xACT GUI. Pages with invalid objects are visible even when removed.");
MGCAddSnippet(304, "Defines the order of controls on a page in Calibre Interactive. ");
MGCAddSnippet(305, "Outputs text to the transcript. ");
MGCAddSnippet(306, "The custom configuration file in Calibre Interactive has commands available that call other commands or functions. The commands specify a callback function and provide a way to execute a shell command.");
MGCAddSnippet(307, "Specifies a function to execute on a signal from the Calibre Interactive xACT GUI. ");
MGCAddSnippet(308, "The launchCommand function executes an external (shell) command. ");
MGCAddSnippet(309, "The launchCommandReturnString function executes an external (shell) command that returns a string. ");
MGCAddSnippet(310, "Several functions are available for the Calibre Interactive xACT custom configuration file that add a #DEFINE and #UNDEFINE to the Calibre Interactive control file. ");
MGCAddSnippet(311, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a value to the Calibre Interactive xACT GUI; the value is taken from an enumerated list. The statement is added to the control file.");
MGCAddSnippet(312, "Adds a control to specify a #DEFINE or #UNDEFINE statement with no value to the Calibre Interactive xACT GUI. The statement is added to the control file. ");
MGCAddSnippet(313, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive xACT GUI, where the string value is expected to correspond to a directory used for input. The statement is added to the control file. The control includes a text input field and a browser button for selecting the directory. ");
MGCAddSnippet(314, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive xACT GUI, where the string value is expected to correspond to an input file. The statement is added to the control file. The control includes a text entry field, a file browser button for selecting the file, and a view file button. ");
MGCAddSnippet(315, "Adds a control to specify a #DEFINE or #UNDEFINE statement with an integer value to the Calibre Interactive xACT GUI. The statement is added to the control file. ");
MGCAddSnippet(316, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive xACT GUI, where the string value is expected to correspond to a directory used for output. The statement is added to the control file. The control includes a text input field and a browser button for selecting the directory. ");
MGCAddSnippet(317, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive xACT GUI, where the string value is expected to correspond to an output file. The statement is added to the control file. The control includes a text input field, a file browser button for selecting the file, and a view file button. ");
MGCAddSnippet(318, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a floating-point value to the Calibre Interactive xACT GUI. The statement is added to the control file. ");
MGCAddSnippet(319, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive xACT GUI. The GUI control is a multi-line text box. The statement is added to the control file. ");
MGCAddSnippet(320, "Adds a control to specify a #DEFINE or #UNDEFINE statement with a string value to the Calibre Interactive xACT GUI. The statement is added to the control file. ");
MGCAddSnippet(321, "Several functions are available for the Calibre Interactive xACT custom configuration file that add a Variable statement to the Calibre Interactive control file. ");
MGCAddSnippet(322, "Adds a control to specify a Variable statement with a value to the Calibre Interactive xACT GUI; the value is taken from an enumerated list. The statement is added to the control file. ");
MGCAddSnippet(323, "Adds a control to specify a Variable statement to the Calibre Interactive xACT GUI, where the assigned value for the variable is a list. The statement is added to the control file. ");
MGCAddSnippet(324, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive xACT GUI, where the string value is expected to correspond to a directory used for input. The Variable statement is added to the control file. The control includes a text entry field and a browser button for selecting the directory.");
MGCAddSnippet(325, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive xACT GUI, where the string value is expected to correspond to an input file. The Variable statement is added to the control file. The control includes a text entry field, a file browser button for selecting the file, and a view file button.");
MGCAddSnippet(326, "Adds a control to specify a Variable statement with an integer value to the Calibre Interactive xACT GUI. The statement is added to the control file. ");
MGCAddSnippet(327, "Adds a control to specify a Variable statement with a value to the Calibre Interactive xACT GUI. The value is taken from an enumerated list and multiple values can be selected. The statement is added to the control file. ");
MGCAddSnippet(328, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive xACT GUI, where the string value is expected to correspond to a directory used for output. The Variable statement is added to the control file. The control includes a text entry field and a browser button for selecting the directory.");
MGCAddSnippet(329, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive xACT GUI, where the string value is expected to correspond to an output file. The Variable statement is added to the control file. The control includes a text entry field, a file browser button for selecting the file, and a view file button.");
MGCAddSnippet(330, "Adds a control to specify a Variable statement with a real value to the Calibre Interactive xACT GUI. The statement is added to the control file. ");
MGCAddSnippet(331, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive xACT GUI. The GUI control is a multi-line text box. The statement is added to the control file. ");
MGCAddSnippet(332, "Adds a control to specify a Variable statement with a string value to the Calibre Interactive xACT GUI. The statement is added to the control file. ");
MGCAddSnippet(333, "Several functions are available for the Calibre Interactive xACT custom configuration file to specify pre- and post-execution trigger functions. The trigger functions can run before or after the batch Calibre run, and can run in the shell environment or the design tool environment. ");
MGCAddSnippet(334, "Certain filenames and other parameters from the Calibre Interactive GUI can be passed to a trigger function using replaceable parameters. For example, the top cell name and the source netlist name can be passed to a trigger function using replaceable trigger parameters %L and %s, respectively. ");
MGCAddSnippet(335, "A set of function calls to add trigger definitions to the Triggers page in the Calibre Interactive xACT GUI. Trigger execution is relative to the Calibre nmLVS or Calibre xACT step. Triggers can execute in the shell environment or the design tool environment. ");
MGCAddSnippet(336, "You can add buttons to the Calibre Interactive xACT GUI and specify a callback function that is executed when the button is clicked. ");
MGCAddSnippet(337, "Adds a user-defined button with a callback function to the Calibre Interactive xACT GUI.");
MGCAddSnippet(338, "Adds a user-defined button with a callback function to the Calibre Interactive xACT GUI. The button has a dropdown list of choices. ");
MGCAddSnippet(339, "There are some common errors in writing the configuration file for customization the Calibre Interactive xACT GUI. This section outlines methods for finding and fixing these errors. ");
MGCAddSnippet(340, "The Calibre Interactive PERC GUI allows you to specify command line options and select rule file statements for a Calibre PERC run. You can save GUI settings to a Calibre Interactive runset and load them in future runs. ");
MGCAddSnippet(341, "The Calibre Interactive PERC Graphical User Interface (GUI) allows you to specify command line options and selected rule file statements that control a Calibre PERC run.");
MGCAddSnippet(342, "You need to load a rule file for any Calibre PERC run. You can load a rule file automatically with a runset or you can specify one manually using this procedure.");
MGCAddSnippet(343, "You can specify a hierarchical, flat, or Calibre PERC LDL run type, and choose to analyze the geometric layout, the layout netlist, or the source netlist.");
MGCAddSnippet(344, "Inputs for a Calibre Interactive PERC run are specified on the Inputs pane, with some options available on the PERC Options pane. You specify the layout or source input, the run type, and Hcell data. ");
MGCAddSnippet(345, "The inputs you specify for a Calibre PERC run depend on the type of analysis you choose. The basic procedure for specifying Calibre PERC inputs is outlined here; see the individual sections for detailed instructions. ");
MGCAddSnippet(346, "The origin of your input is different depending on whether you run Calibre Interactive connected to a layout or schematic viewer or not. ");
MGCAddSnippet(347, "When you analyze a geometric layout in a Calibre PERC run, the layout can be exported from an open layout viewer or come from database files. Calibre PERC extracts the layout netlist before doing the analysis. ");
MGCAddSnippet(348, "Layout data for a Calibre Interactive PERC run is specified on the Inputs pane on the Layout tab. You can export the layout from an open design tool. The layout netlist is extracted from the geometric layout.");
MGCAddSnippet(349, "Layout data for a Calibre Interactive PERC run is specified on the Inputs pane on the Layout tab. You can read the layout data from design files saved on disk. The layout netlist is extracted from the geometric layout.");
MGCAddSnippet(350, "When you analyze a layout netlist in a Calibre PERC run, the layout netlist must already exist as a SPICE file. ");
MGCAddSnippet(351, "When you analyze a source netlist in a Calibre PERC run, the source netlist can be exported from an open schematic viewer or come from an existing netlist file. ");
MGCAddSnippet(352, "You can read source netlist data from a connected schematic viewer in Calibre Interactive PERC. ");
MGCAddSnippet(353, "You can read source netlist data from file in Calibre Interactive PERC. ");
MGCAddSnippet(354, "Hcells are used in a Calibre PERC run to specify subcircuits in the input that are preserved. ");
MGCAddSnippet(355, "You can specify the probe mapping file for a Calibre PERC LDL run using Calibre Interactive. ");
MGCAddSnippet(356, "If your primary cell has references to other additional database files you may need to load multiple layouts. You can specify multiple layouts using the DatabaseLibrary sub-tab on the PERC Options pane.");
MGCAddSnippet(357, "You can specify a Calibre PERC Waiver description file in Calibre Interactive PERC. This causes the Calibre PERC Waiver flow to be used during the Calibre PERC run. ");
MGCAddSnippet(358, "You can specify the Calibre PERC cell-based flow in Calibre Interactive. This flow is part of the Calibre PERC LDL (Logic-Driven Layout) functionality. The flow assumes LEF/DEF design input instead of SPICE and performs topological checking without considering devices. ");
MGCAddSnippet(359, "You can generate a rule file for a Calibre PERC run with the Calibre PERC Rule Generator GUI. The rule checks that can be included are part of the high-level checks flow in Calibre PERC. You specify the various parameters and input files for each rule check using the rule generator GUI. ");
MGCAddSnippet(360, "Outputs for a Calibre PERC run include the PERC report file and the SVDB. The output for a Calibre PERC-LDL run is a DFM Database, which is specified in the rule file.");
MGCAddSnippet(361, "Use the following procedure to start a Calibre PERC run from Calibre Interactive PERC.");
MGCAddSnippet(362, "You can control how your Calibre PERC job is run by configuring options related to performance, remote and distributed computing, and license acquisition. ");
MGCAddSnippet(363, "You can specify options for your Calibre PERC run from the PERC Options panel. These settings generate SVRF specification statements in your control file. If the rule file you load has SVRF statements that correspond to these GUI options, the GUI is populated with the rule file settings. Whatever options you specify in the GUI override the rule file settings. ");
MGCAddSnippet(364, "You use the Supply tab on the PERC Options pane to specify power and ground net names.");
MGCAddSnippet(365, "If you use Sconnect statements in your rule file and encounter errors during your run, you can have Calibre PERC abort automatically on soft connection conflicts.");
MGCAddSnippet(366, "These settings control the verbosity of the Calibre PERC report and the maximum number of results reported.");
MGCAddSnippet(367, "These options instruct Calibre to build the layout netlist using either transistors or logic gates.");
MGCAddSnippet(368, "You can control how split gates are reduced on the Gates tab of the Setup PERC Options pane. These controls are the same as for Calibre Interactive nmLVS. ");
MGCAddSnippet(369, "You can filter out specific unused devices in your layout and source using the Filter Unused Device Options table in the Gates tab of the PERC Options pane. ");
MGCAddSnippet(370, "You can use the Properties tab on the PERC Options pane in Calibre Interactive to override the Trace Property statements in your rule file. This may be useful when running the Calibre PERC LDL DRC source-based flow. You can add new statements, edit existing statements, and disable statements. ");
MGCAddSnippet(371, "The Customization GUI in Calibre Interactive enables you program controls to customize various settings for your Calibre run. The customization file is a Tcl script with commands in the CUSTOM namespace.");
MGCAddSnippet(372, "Customization files allow you to customize several settings that affect Calibre runs. The customization file creates a Customizations Settings dialog box, or Customization GUI, which you display with Calibre Interactive. ");
MGCAddSnippet(373, "The customization file is specified in the Startup tab of the Setup Preferences dialog box. ");
MGCAddSnippet(374, "The topics in this section provide full details on each aspect of specifying and using the Customization GUI. Most actions can be performed in more than one way. ");
MGCAddSnippet(375, "The customization file can be specified using the Calibre Interactive GUI, with an environment variable, or on the command line.");
MGCAddSnippet(376, "You can open the Customization Settings dialog box automatically when the runset is opened, manually with the Customization button, or during a Calibre Interactive batch run.");
MGCAddSnippet(377, "The Customization Settings dialog box, or Customization GUI, contains the customization controls specified in the customization file. Several action buttons, such as Load and Reset, are also included.");
MGCAddSnippet(378, "Settings in the Customization GUI are kept internally during the current Calibre Interactive session when you click OK in the Customization Settings dialog box. Customization settings are saved to the runset as customization overrides when you save a runset. ");
MGCAddSnippet(379, "Customization overrides are the changed settings in the Customization GUI. The changed settings are saved in the runset option cmnCustomFileOverrideValues and then applied the next time you load the runset. Customization overrides let you save and automatically restore settings you make in a Customization GUI.");
MGCAddSnippet(380, "This Calibre Interactive runset option saves Customization GUI settings that are changed from the initial settings in the customization file. The new settings, or overrides, are applied the next time the runset is loaded. Only changed settings are saved to cmnCustomFileOverrideValues.");
MGCAddSnippet(381, "Customization files can be used in Calibre Interactive batch mode. The methods for using the Customization GUI differ from the usage in interactive mode.");
MGCAddSnippet(382, "You can specify the customization file for a batch mode run in the runset or on the command line.");
MGCAddSnippet(383, "The Customization GUI is displayed in Calibre Interactive batch mode runs invoked with the ‑customgui command-line option. You can control whether or not changes to the Customization GUI are saved to the runset. The settings on the Misc tab of the Setup Preferences dialog box for saving a runset also apply to Calibre Interactive batch runs.");
MGCAddSnippet(384, "The CUSTOM::CHECK controls in the Customization GUI interact with the check selection methods for Calibre Interactive nmDRC, Calibre Interactive DFM, and Calibre Interactive nmLVS. It is important to know the precedence of the various check selection methods. ");
MGCAddSnippet(385, "Customization files use Tcl/Tk, with API commands defined in the CUSTOM namespace. The CUSTOM commands control the elements in the customization dialog. The customization file is sourced by Calibre Interactive as a Tcl file; therefore all Tcl/Tk statements and constructs are available to the customization file developer.");
MGCAddSnippet(386, "If you are not familiar with Tcl coding, this section described basics, such as command syntax and special characters. ");
MGCAddSnippet(387, "The list is a basic data structure in Tcl, and is used in several customization commands. A Tcl list is an ordered collection of numbers, strings, or other lists.");
MGCAddSnippet(388, "Siemens EDA recommends that you take advantage of the excellent books and websites on the language. The list that follows is provided to give you a place to start in your search for the reference material that works best for you. It is not an endorsement of any book or website. While every attempt has been made to ensure that the URLs listed here point to active websites, there is no guarantee of this.");
MGCAddSnippet(389, "The customization commands allow you to construct the Customization GUI. ");
MGCAddSnippet(390, "The customization commands are functionally divided into three groups: control file statements, runset control statements, and Customization GUI appearance statements.");
MGCAddSnippet(391, "In Calibre Interactive nmLVS, the CUSTOM::CHECK command initializes the check selection status in the Select Checks dialog box for ERC checks in Calibre Interactive nmLVS. ");
MGCAddSnippet(392, "Inserts a #DEFINE or #UNDEFINE pre-processor directive in the Calibre Interactive control file, or a Tcl variable in the case of TVF rule files. ");
MGCAddSnippet(393, "Inserts a text label in the customization dialog box.");
MGCAddSnippet(394, "Inserts a horizontal separator line in the customization dialog box.");
MGCAddSnippet(395, "Sets the size and location of the customization window.");
MGCAddSnippet(396, "Inserts a Variable statement in the Calibre Interactive control file, or defines a Tcl variable in the case of TVF rule files.");
MGCAddSnippet(397, "Gets the current Calibre version string.");
MGCAddSnippet(398, "Returns the setting of the Calibre Interactive GUI control given by the specified runset option name.");
MGCAddSnippet(399, "Determines if the input parameter is a valid GUI control name.");
MGCAddSnippet(400, "Populates the setting of the Calibre Interactive GUI control given by name with the specified value.");
MGCAddSnippet(401, "Specifies a callback procedure that is executed when you click the OK button in the Customization GUI. If the Customization GUI is not displayed in a Calibre Interactive batch run, the callback procedure is automatically executed. ");
MGCAddSnippet(402, "Specifies an error message that is displayed if the function specified by CUSTOM::setOKCallback returns -1.");
MGCAddSnippet(403, "You can specify that the visibility of one control (the dependent control) depends on the state of one or more other controls (the primary) in the customization file. ");
MGCAddSnippet(404, "You can have the customization GUI verify that the input for a text entry field is of the correct type. The CUSTOM::DEFINE and CUSTOM::VARIABLE commands allow text entry fields and input type checking.");
MGCAddSnippet(405, "Each of the CUSTOM commands returns a Tk widget. The Tk widget can be invoked with the standard Tk options config or cget.");
MGCAddSnippet(406, "Several customization file examples are included in the section. ");
MGCAddSnippet(407, "You can read and set Calibre Interactive GUI controls using a customization file, as shown in this example. ");
MGCAddSnippet(408, "The customization file in this example selects the ERC rule checks that are executed in a Calibre Interactive nmLVS run. ");
MGCAddSnippet(409, "The following example contains many of the commands and options possible for customization files. ");
MGCAddSnippet(410, "You can use the Tcl source command to create a customization file that loads multiple customization files; the following example shows such a file. ");
MGCAddSnippet(411, "Calibre Interactive can execute trigger functions before and after Calibre Interactive execution and before and after the Calibre run.");
MGCAddSnippet(412, "Triggers are functions that execute at specific times in your work flow. Calibre Interactive has two types of triggers: external, which execute before and after Calibre Interactive, and internal, which execute before and after the Calibre run. ");
MGCAddSnippet(413, "Calibre Interactive provides the ability to specify and run pre- and post-execution internal triggers. The trigger program is run immediately before or after batch Calibre. A trigger can be any program or script that can be executed from the Linux shell. Triggers can also run in supported design tools; in this case the trigger is written in the API language for the design tool. ");
MGCAddSnippet(414, "Various filenames and other key values specified in the GUI can be passed as replaceable parameters that are expanded and passed to the internal trigger program. ");
MGCAddSnippet(415, "You can instruct Calibre Interactive to run internal triggers before and after the Calibre run. Multiple trigger functions may be specified for each stage. If you are connected to a supported design tool, you can also specify procedures that run in the design tool environment. ");
MGCAddSnippet(416, "The Triggers tab on the Setup Preferences dialog box allows you to specify triggers that run in the design tool environment (the trigger Type of  layout  or  schematic .) By default, a layout or schematic trigger can only run in the design tool session that launched the Calibre Interactive session. ");
MGCAddSnippet(417, "The way in which Calibre Interactive saves trigger definitions in the runset differs according to the Calibre version.");
MGCAddSnippet(418, "Several examples are provided for Calibre Interactive internal triggers.");
MGCAddSnippet(419, "This example calls the  echo  utility with the trigger parameter %d as an argument. %d is replaced by the run directory at runtime.");
MGCAddSnippet(420, "This example calls a custom script with the trigger parameter %r as an argument. %r is replaced by the rule file path at runtime.");
MGCAddSnippet(421, "In this example an internal pre-execution trigger parses the topcell parameter and creates a file that is used as an INCLUDE file with the rule file for the Calibre run. The created file contains a Variable statement.");
MGCAddSnippet(422, "You can specify a Calibre Interactive internal trigger that runs in Calibre DESIGNrev and counts the number of cells in the layout. ");
MGCAddSnippet(423, "In some development environments, a system administrator may define a global or project-level runset that sets options for all Calibre Interactive applications. In this case, it can be useful for the same runset to define internal pre‑ and post‑execution triggers that differ according to Calibre Interactive application; this is possible in 2011.4 and later releases.");
MGCAddSnippet(424, "Calibre Interactive external triggers operate when you start Calibre Interactive from a layout or schematic viewer that supports external triggers. External triggers are written in the API for the supported design environment using the API language (Tcl, SKILL, or Scheme, for example). The triggers can be used to run custom routines that check or set environment variables or call setup and post-processing functions. ");
MGCAddSnippet(425, "External triggers execute in the design tool environment before and after Calibre Interactive execution. There are two types of external triggers: pre-execution and post-execution. ");
MGCAddSnippet(426, "The external trigger functions and the file locations depend on the design tool that is used. ");
MGCAddSnippet(427, "You can define Calibre Interactive external pre- and post-execution triggers in Calibre DESIGNrev. This section gives the function name and the location of the file containing the function definition. ");
MGCAddSnippet(428, "You can define Calibre Interactive external pre- and post-execution triggers in Cadence Virtuoso. This section gives the procedure name and the location of the file containing the procedure definition. ");
MGCAddSnippet(429, "You can define Calibre Interactive external pre- and post-execution triggers in Synopsys IC Compiler. This section gives the procedure name and the location of the file containing the procedure definition. ");
MGCAddSnippet(430, "Tcl and SKILL examples are provided for Calibre Interactive external triggers. ");
MGCAddSnippet(431, "The following code is an example of a pre-execution external trigger in Tcl. ");
MGCAddSnippet(432, "The following example shows an external pre-execution trigger in the SKILL language for the Cadence Virtuoso design environment. This procedure can be defined in your .cdsinit file. The trigger defines a runset using an environment variable. ");
MGCAddSnippet(433, "The following sections in this chapter provide important information about setting up Calibre jobs and choosing a licensing behavior. ");
MGCAddSnippet(434, "Calibre Interactive allows you to run Calibre jobs on local, remote, and distributed resources. You can choose single threaded, multithreaded, or distributed execution with a choice of options such as number of CPUs and hyperscaling.");
MGCAddSnippet(435, "Large Calibre jobs may benefit from the performance of a computer cluster (also known as load balancing distributed resources). Calibre Interactive offers an interface for setting up execution of Calibre jobs on IBMSpectrumLSF and Univa Grid Engine, along with a generic interface for other distributed computing solutions.");
MGCAddSnippet(436, "You can specify that your Calibre Interactive job runs on the IBM Spectrum LSF computing system. ");
MGCAddSnippet(437, "Custom options specified in the Resource Options column have priority over options specified in the individual table columns. The following examples of resource option statements illustrate the use of both custom filters and standard column filters.");
MGCAddSnippet(438, "The Univa Grid Engine is an open source batch-queuing system. For complete details on configuring this environment, refer to the product s documentation.");
MGCAddSnippet(439, "The  Other Cluster  option provides a generic interface for configuring distributed computer solutions.");
MGCAddSnippet(440, "Several replaceable parameters are available for use in the Queue Command field for an  Other Cluster  run.");
MGCAddSnippet(441, "Calibre MTflex allows you to use your existing network as a low-cost distributed computing platform. ");
MGCAddSnippet(442, "The selections in the Environment tab in Calibre Interactive allow you to set parameters such as executable paths and environment variables that control remote host execution.");
MGCAddSnippet(443, "You can control licensing options using Calibre Interactive.");
MGCAddSnippet(444, "This section provides detailed information on run control options such as hyperscaling, backup data, and remote data server (RDS). ");
MGCAddSnippet(445, "Hyperscaling is a mode of multithreaded operations that improves performance and scalability of CPU usage. It is enabled through the  Hyperscale  option on the Performance tab of the run Control pane. It enables the same functionality as the -hyper command line switch for the Calibre batch tools.");
MGCAddSnippet(446, "When  Hyperscale Compare  is enabled, Calibre nmLVS-H runs certain portions of LVS comparison concurrently with LVS circuit extraction. This reduces the run time for a hierarchical LVS run that requires both extraction and comparison. ");
MGCAddSnippet(447, "When  Hyperscale PathChk  is enabled, Calibre nmLVS-H runs certain portions of LVS comparison concurrently with Pathchk layer operations in hierarchical databases. This option is useful if Pathchk operations take the majority of time in a hyperscaling run. This option increases memory usage.");
MGCAddSnippet(448, "The Calibre Remote Data Server (RDS) technology is designed to reduce local (primary) memory requirements and improve Calibre MTflex performance by distributing data across remote hosts. ");
MGCAddSnippet(449, "Hyperscale Remote is an option that improves the performance and scaling of hyperscaling. Hyperscale Remote is available in  Distributed (MTflex)  mode when the Remote Data Server (RDS) Option is enabled. These options are not available for Calibre Interactive PEX. ");
MGCAddSnippet(450, "The Backup Data option enables recovery in the event of a catastrophic remote host failure; it uses the ‑recoverremote command line option. Backup Data is available in  Distributed (MTflex)  mode when the Remote Data Server (RDS) Option is enabled. These options are not available for Calibre Interactive PEX. ");
MGCAddSnippet(451, "The ability to communicate with industry standard design tools is an important feature of Calibre Interactive. This chapter discusses how to use Calibre Interactive with some of the design tool integrations. It also explains the setup procedure for the design tools that require custom installation and discusses special operating considerations. ");
MGCAddSnippet(452, "Some interface concepts and actions are common to all integrated layout and schematic viewers, as explained in these sections:");
MGCAddSnippet(453, "To start Calibre Interactive from an integrated viewer, choose the desired interface from the menu, depending on your viewer. ");
MGCAddSnippet(454, "Calibre Interactive uses certain default port numbers for socket communication with a connected layout or schematic viewer. The port numbers can also be set manually, as described here. Individual layout and schematic viewers may have additional methods for setting the port numbers; see the section for the specific viewer.");
MGCAddSnippet(455, "You can set the socket port manually using the Calibre Interactive GUI, or using an environment variable. By default, Calibre Interactive uses socket port 9189 to communicate with the layout viewer. The tool automatically searches for an available socket if it cannot obtain the default socket. It initializes the first available socket between the numbers 5000 and 9999 and reports the socket number through a dialog box. ");
MGCAddSnippet(456, "You can set the socket port manually using the Calibre Interactive GUI, or using an environment variable. By default, Calibre Interactive uses socket port 9199 to communicate with the schematic viewer. The tool automatically searches for an available socket if it cannot obtain the default socket. It initializes the first available socket between the numbers 5000 and 9999 and reports the socket number through a dialog box. ");
MGCAddSnippet(457, "You can add custom, or user-defined, menu items to supported design tools. The custom menu items are added to the integration menu.");
MGCAddSnippet(458, "The following procedure describes how to add custom menu items to the supported design tools. ");
MGCAddSnippet(459, "The menu customization file must be valid Tcl syntax. ");
MGCAddSnippet(460, "Several commands are available for creating custom menus in supported design tools. ");
MGCAddSnippet(461, "Returns the name of the design tool reading the menu customization file.");
MGCAddSnippet(462, "Adds a menu item to the indicated menu (by default, the root Calibre or Verification menu). Pre-execution code that executes in the design tool environment can also be specified for a command menu item. ");
MGCAddSnippet(463, "Removes an item from the indicated menu (by default, the root Calibre or Verification menu).");
MGCAddSnippet(464, "The menu labels for the Calibre integration changed in some design tools with the 2014.2 release. Menu customization files written for previous releases are still read correctly if they use the earlier menu label in the ‑before and ‑after options to specify the placement of a custom menu item. ");
MGCAddSnippet(465, "This customization file works with any supported design tool. It deletes the DFM and 3DSTACK menu items, and adds two new menu items and a submenu. ");
MGCAddSnippet(466, "Calibre DESIGNrev and Calibre WORKbench include a Verification menu for starting Calibre Interactive, Calibre RVE, and some Calibre Pattern Matching applications. ");
MGCAddSnippet(467, "By default, Calibre Interactive and Calibre RVE use socket port 9189 for communication. The tool automatically searches for an available socket if it cannot obtain the default socket. ");
MGCAddSnippet(468, "To start Calibre Interactive from Calibre DESIGNrev or Calibre WORKbench, choose Verification and choose the desired interface. ");
MGCAddSnippet(469, "The IC Station product family changed its name to Pyxis with the v10.0 release of Pyxis, and this manual therefore refers to the Pyxis product. Pyxis has a Calibre pulldown menu with selections to open Calibre Interactive and Calibre RVE. ");
MGCAddSnippet(470, "By default, Calibre Interactive and Calibre RVE use socket port 9189 to communicate with Pyxis Layout. The tool automatically searches for an available socket if it cannot obtain the default socket. ");
MGCAddSnippet(471, "Select the desired option from the Calibre menu to open the corresponding Calibre Interactive application. ");
MGCAddSnippet(472, "Calibre Interactive is integrated to the viewers Siemens Tanner S-Edit, a schematic viewer, and L-Edit, a layout design tool.");
MGCAddSnippet(473, "The following sections describe the Calibre interface to Cadence Virtuoso:");
MGCAddSnippet(474, "Calibre Interactive and Calibre RVE support Cadence Virtuoso versions 5.1, 6.1, 6.18, 12.1, 12.2, 12.3, and 18.1. ");
MGCAddSnippet(475, "The Calibre menu in Cadence Virtuoso layout and schematic windows (windows of type maskLayout or schematic by default) has the selections to start Calibre Interactive, start Calibre RVE, set up options, and map schematic nets.");
MGCAddSnippet(476, "You can control the layout export from Cadence Virtuoso with the Calibre Layout Export Setup dialog box and the Cadence Virtuoso template file. You can also use the Cadence Virtuoso streamOutKeys or oasisOutKeys variables. ");
MGCAddSnippet(477, "The Calibre Layout Export Setup dialog box sets options that control layout export from Cadence Virtuoso to Calibre. Environment variables and SKILL variables can be used in filenames. From Cadence, choose CalibreSetupLayout Export to open the layout export dialog box.");
MGCAddSnippet(478, "You can use a template file to control the layout export when using Calibre Interactive with Cadence Virtuoso. The template file is specified with the global variable mgc_calibre_export_layout_template_file (GDSII) or mgc_calibre_export_layout_oasis_template_file (OASIS) or using the GUI. ");
MGCAddSnippet(479, "Layout export functions are provided for Cadence Virtuoso.");
MGCAddSnippet(480, "Returns a string value consisting of the layout export command used by Calibre Interactive. ");
MGCAddSnippet(481, "SKILL command to load the layout template file specified by the SKILL variable mgc_calibre_export_layout_template_file or mgc_calibre_export_layout_oasis_template_file.");
MGCAddSnippet(482, "Calibre can read the design data directly from the OpenAccess database. This is called Direct Read, in contrast to Layout Export, in which Cadence Virtuoso converts the design to GDS format and streams it out to Calibre Interactive. ");
MGCAddSnippet(483, "Calibre Interactive automatically saves the Express Pcell cache when performing direct read of Cadence Virtuoso OpenAccess databases if the following conditions are met. ");
MGCAddSnippet(484, "Many aspects of netlist export from Cadence Composer are controlled with the Calibre Netlist Export Setup dialog box. The netlist export routines use the Simulation Interface system (si ‑batch) to translate the schematic to CDL when performing netlist export.");
MGCAddSnippet(485, "From Cadence, choose CalibreSetupNetlist Export to open the netlist export dialog box.");
MGCAddSnippet(486, "Netlist export functions are provided for Cadence Virtuoso. ");
MGCAddSnippet(487, "Returns a string value consisting of the netlist export command used by Calibre Interactive. ");
MGCAddSnippet(488, "Loads the netlist template file specified by the SKILL variable mgc_calibre_export_netlist_template_file.");
MGCAddSnippet(489, "The Calibre Interactive interface allows you to run Calibre on a Cadence Virtuoso cell. You can specify settings that control the layout export process.");
MGCAddSnippet(490, "The Calibre SKILL Interface uses a TCP socket to communicate with Calibre RVE and Calibre Interactive. When you load the calibre.skl file, the tool attempts to initialize a server socket at port 9189. If that port is being used, the tool searches for a free socket port in the range 5000 to 9999. ");
MGCAddSnippet(491, "It is often useful to call a SKILL procedure before or after your Calibre run. ");
MGCAddSnippet(492, "A Calibre View of a cell is a schematic view of a cell you can simulate in the Cadence Analog Design Environment. This schematic view contains the connectivity and intentional devices the Calibre LVS tool extracts, and, optionally, parasitic devices the Calibre xRC tool extracts. ");
MGCAddSnippet(493, "Producing a Calibre View requires the correct product licenses, input files, and integration setup. ");
MGCAddSnippet(494, "You can produce the Calibre Views after an LVS run or after a parasitic extraction run. ");
MGCAddSnippet(495, "When Calibre View uses OpenAccess, it must be a compatible version to the version of Cadence Virtuoso being used. Calibre View automatically detects which OpenAccess version to use and warns the user if the version they specified does not match.");
MGCAddSnippet(496, "Several internal steps are involved when device properties are calculated during Calibre View generation. ");
MGCAddSnippet(497, "The Calibre View generated view does not show nets with inherited connectivity that do not exist in schematic. ");
MGCAddSnippet(498, "The generated CalibreView netlist always uses <> as the bus delimiter to avoid conflicts with the standard Cadence schematic netlist, which uses <> as the bus delimiter. If you generate a CalibreView from a netlist which uses [] as the bus delimiter, pin and net names ending in [] are automatically converted to use <> as the bus delimiter. ");
MGCAddSnippet(499, "Before creating a Calibre View, you must create a cellmap file. A cellmap file is an ASCII mapping file used for mapping the layout device to the corresponding schematic symbol. Both intentional devices and parasitic devices can be mapped with the cellmap file.");
MGCAddSnippet(500, "The cellmap file is a text file that is used when creating a Calibre View.");
MGCAddSnippet(501, "The cellmap file is needed for creating a Calibre View.");
MGCAddSnippet(502, "The cellmap statement for intentional devices instructs the Calibre View process on how to map the device.");
MGCAddSnippet(503, "The cellmap statement instructs the Calibre View process on how to map the cell.");
MGCAddSnippet(504, "You can add property specifications to the cellmap file that determine how property information is passed from Calibre to the Calibre View. ");
MGCAddSnippet(505, "Each layer that is imported to a Calibre View requires a mapping statement to identify the corresponding Cadence layer name. ");
MGCAddSnippet(506, "This section describes the cellmap syntax for parasitic devices. ");
MGCAddSnippet(507, "The following cellmap file examples are included in this section:");
MGCAddSnippet(508, "You can have multiple devices with the same modelname, however each device should have different pin counts. ");
MGCAddSnippet(509, "You can map a Calibre device to a Cadence cell containing a greater number of pins. For example, the following cellmap entry would map a 2-pin Calibre device to a 3-pin device:");
MGCAddSnippet(510, "You can map nets connecting to a pin of a device the Calibre tool extracts to a property on a cell the Calibre View instantiates. ");
MGCAddSnippet(511, "The schematic property  fingers  is set to the number of fingers of the device. Since each individual finger in the layout needs fingers=1, we need to set this in the cellmap file, or the schematic property value will be applied to each finger of the device. ");
MGCAddSnippet(512, "This example uses expressions to map a Calibre property to Cadence properties. ");
MGCAddSnippet(513, "To create an optimized cellmap file, you should map the Connect statement layers and Device statement layers. ");
MGCAddSnippet(514, "Calibre layers can be mapped Cadence drawn layers in the cellmap file, and you need to identify the corresponding Calibre layer and Cadence drawn layer.");
MGCAddSnippet(515, "You can specify the cellmap file for Calibre View generation using Calibre Interactive PEX or Calibre Interactive xACT. At run time, the Calibre View cellmap file is also entered in the Cadence Virtuoso  Calibre View Setup  dialog box.");
MGCAddSnippet(516, "Because the Cadence Analog Design framework treats net and instance names in schematics case sensitively, you must add the Source Case statement to your SVRF rule file when creating a Calibre View.");
MGCAddSnippet(517, "Intentional devices and cells without mapping information in the cellmap file are automatically mapped (auto-mapped) and instantiated in the generated Calibre View. By default, the mapping uses case-sensitive matching of pin names followed by order-based mapping. You can specify a different auto-map behavior with the environment variable MGC_FDI_PIN_AUTOMAP_METHOD. You can also specify that information about the auto-map process be printed to the transcript with the environment variable MGC_FDI_ENABLE_AUTOMAP_LOGGING. ");
MGCAddSnippet(518, "The Calibre View Setup dialog box has settings for several aspects of the Calibre View creation process.");
MGCAddSnippet(519, "Calibre Interactive and Calibre RVE generate a Calibre View for the top-level cell, regardless of the cell context set in the tools. The tools generate net and device names in the Calibre View from the source (or schematic) name space, unless nets and devices were unmatched during LVS comparison. In the latter case, the tool prefixes layout names with a  _Layout .");
MGCAddSnippet(520, "The post-parasitic extraction Calibre View includes parasitic elements as well as intentional devices.");
MGCAddSnippet(521, "A gate-level Calibre View includes parasitics from the top-level routing plus symbols for the cells. ");
MGCAddSnippet(522, "When you generate a Calibre View with multiple corners selected for extraction, a Calibre View is created for each corner. ");
MGCAddSnippet(523, "You can generate a SPECTRE netlist from the Calibre View netlist using the Cadence Analog Design Environment (ADE). Cellmap information is used in the netlist generation, unlike the case when generating a SPECTRE netlist from Calibre xRC, in which source names are used. ");
MGCAddSnippet(524, "The CalibreView setup file contains all the settings necessary to generate a CalibreView. You can use the file as input to the SKILL function mgc_rve_load_setup_file to create the CalibreView in batch mode, without opening the Calibre View Setup dialog box. The file can also be loaded into the Calibre View Setup dialog box in order to populate the dialog box with saved settings. ");
MGCAddSnippet(525, "You can use the display and annotation of parasitic polygons to more easily analyze design parasitics. ");
MGCAddSnippet(526, "The CalibreView setup file allows you to specify the parameters for CalibreView creation without opening the Calibre View Setup dialog box. ");
MGCAddSnippet(527, "Several functions are provided that allow you to create a Calibre View from the command interpreter without opening the Calibre Interactive GUI or Calibre RVE. ");
MGCAddSnippet(528, "Several global variables are provided that are used in the creation of a Calibre View.");
MGCAddSnippet(529, "The SKILL function mgc_rve_load_setup_file() uses the parameters in the CalibreView setup file to create a CalibreView without opening the Calibre View Setup dialog box.");
MGCAddSnippet(530, "Calibre View creation is designed to work with the IC Manage integration to Cadence Virtuoso. ");
MGCAddSnippet(531, "This section describes warnings from Calibre View generation. ");
MGCAddSnippet(532, "The delimiter for bus names may be <> or [], depending on the convention used in the schematic netlist. You can convert the bus delimiter, if needed.");
MGCAddSnippet(533, "You can instruct the tool to convert the bus name delimiter from <> to [] when the schematic netlist is exported for a Calibre Interactive run.");
MGCAddSnippet(534, "In some cases Calibre Interactive or Calibre RVE is using [] as the bus name delimiter but the tool is interfacing with a Cadence schematic view that uses <> as the bus name delimiter. You can convert the bus name delimiter so that net selection and highlighting is handled correctly.");
MGCAddSnippet(535, "A typical step after parasitic extraction is the simulation of an extracted Calibre View in the Cadence Analog Design Environment. The method you use depends on whether you have multiple extracted Calibre Views or just one. ");
MGCAddSnippet(536, "A typical step after parasitic extraction is the simulation of an extracted Calibre View in the Cadence Analog Design Environment. You can select nets to plot using the selection CalibreMap Schematic Net from the Cadence Virtuoso Schematic Editor. ");
MGCAddSnippet(537, "A typical step after parasitic extraction is the simulation of an extracted Calibre View in the Cadence Analog Design Environment (ADE). After you select nets to plot in the Cadence Analog Design Environment, you can convert between CalibreView names and schematic names with the selections CalibreMap Schematic Nets to CalibreView Nets and CalibreMap CalibreView Nets to Schematic Nets. The text file extviews.txt provides the mapping between the extracted views and the cells.");
MGCAddSnippet(538, "When generating a Point to Point report to be viewed in the Map Schematic Nets to CalibreView Nets dialog box, you can include details on the resistances for specified nets. When enabled, information on each individual resistor is displayed, and highlighting it displays the resistor.");
MGCAddSnippet(539, "When debugging parasitics in the design it is sometimes useful to backannotate the schematic with the extracted parasitic values. This can be done using the dialog box  Map Schematic Nets to CalibreView Nets . Backannotation can also be deleted.");
MGCAddSnippet(540, "Environment variables can be set by custom scripts, or with Calibre Interactive pre-execution triggers for use within the Cadence Design Environment. The following script shows how Calibre Interactive execution triggers can be used within the Cadence Design Environment to automatically specify a Calibre Interactive runset based on the technology library attached to the design.");
MGCAddSnippet(541, "The Cadence Composer integration is similar to that for Cadence Virtuoso.");
MGCAddSnippet(542, "Calibre includes software that enables seamless integration of Calibre Interactive and Calibre RVE within the Cadence Encounter platform. A Calibre menu is activated when the supplied software is loaded into the Encounter environment, usually through the cal_enc.tcl file. ");
MGCAddSnippet(543, "The following script can be inserted into the enc.tcl file to load the Calibre software:");
MGCAddSnippet(544, "You can populate the CalibreSetupVerilog Export dialog box with the parameters used by the saveNetlist command in Cadence Encounter. ");
MGCAddSnippet(545, "Calibre Interactive and Calibre RVE are integrated with the CadenceInnovus Implementation System. The Calibre menu is added when the integration code is loaded. ");
MGCAddSnippet(546, "Integration code must be loaded to enable the Calibre integration to Cadence Innovus. The integration is supported for Calibre RVE and all Calibre Interactive applications except Calibre Interactive 3DSTACK. ");
MGCAddSnippet(547, "Calibre provides an integration of Calibre Interactive and Calibre RVE to Synopsys IC Compiler and Synopsys IC Compiler II. The integration makes it easy to run Calibre flows in the Synopsys IC Compiler environment and debug the results. ");
MGCAddSnippet(548, "The interactive flow with Calibre Interactive, Calibre RVE, and Synopsys IC Compiler allows you to easily run Calibre and debug results. The flow with Calibre nmDRC is illustrated.");
MGCAddSnippet(549, "The Calibre interface to Synopsys IC Compiler supports the Calibre nmDRC, Calibre nmLVS, Calibre PERC, PEX, and DFM applications for both Calibre Interactive and Calibre RVE. The Calibre menu is available after the interface is loaded. Synopsys IC Compiler II is also supported. ");
MGCAddSnippet(550, "The Calibre interface can be loaded automatically each time you start Synopsys IC Compiler, or you can manually install the interface. The Calibre—IC Compiler interface supports Synopsys IC Compiler versions through 2014.9. Synopsys IC Compiler II version M-2016.12-SP2 is supported. ");
MGCAddSnippet(551, "The Calibre interface can be loaded automatically each time you start Synopsys IC Compiler II, or you can manually install the interface. Synopsys IC Compiler II version M-2016.12-SP2 is supported. ");
MGCAddSnippet(552, "The README file for the Calibre -IC Compiler integration is at the following location:");
MGCAddSnippet(553, "The Calibre menu is available after Calibre interface is loaded. The menu has selections to start Calibre Interactive, Calibre RVE, and to selection setup options.");
MGCAddSnippet(554, "All Calibre Interactive applications are supported: Calibre nmDRC, Calibre nmLVS, DFM, Calibre PERC, and PEX. ");
MGCAddSnippet(555, "Calibre Interactive and Calibre RVE communicate with Synopsys IC Compiler through a socket port. Socket communication is established automatically when you start Calibre Interactive or Calibre RVE from the Calibre menu in Synopsys IC Compiler. By default, Calibre Interactive and Calibre RVE use socket port 9189 for communication, and the tool automatically searches for an available socket if it cannot obtain the default socket.  Synopsys IC Compiler II is also supported.");
MGCAddSnippet(556, "Several common problem may occur in the Calibre Interface with Synopsys IC Compiler.");
MGCAddSnippet(557, "The Silvaco Expert design tool includes integrations to Calibre Interactive nmDRC, Calibre Interactive nmLVS, Calibre RVE, and a custom interface to launch a batch Calibre nmDRC job. You can use these interfaces to launch a Calibre verification run from Silvaco Expert, then use Calibre RVE to highlight the errors in the open design. ");
MGCAddSnippet(558, "Silvaco Expert requires the MGC_HOME environment variable to be set and pointing to the location of the Calibre installation. It is good practice to also define CALIBRE_HOME in the same manner.");
MGCAddSnippet(559, "Calibre Interactive and Calibre RVE use certain default port numbers for socket communication with a connected design tool. By default, Calibre Interactive and Calibre RVE use socket port 9189 to communicate with a layout editor. The tool automatically searches for an available socket if it cannot obtain the default socket. When Silvaco Expert successfully opens a socket, it reports the socket number to the log file.");
MGCAddSnippet(560, "The Calibre menu in Silvaco Expert is at VerificationCalibre. ");
MGCAddSnippet(561, "Some viewer integrations are not discussed here because the integration is straightforward and does not require any special setup actions or custom commands for operation.");
MGCAddSnippet(562, "Calibre Interactive and Calibre View generation read a number of environment variables that specify run-time behavior. Some environment variables apply to more than one application.");
MGCAddSnippet(563, "Several environment variables are available to control the behavior of Calibre Interactive. ");
MGCAddSnippet(564, "Several environment variables are available to control Calibre View generation.");
MGCAddSnippet(565, "A Calibre Interactive runset is a text file created by Calibre Interactive to store the settings you specify in the GUI. You can load a runset into Calibre Interactive to restore the GUI interface to the saved settings. This appendix gives the runset file format and option names. ");
MGCAddSnippet(566, "Calibre Interactive runset files are built automatically using the Calibre Interactive GUI. Although not recommended, it is possible to manually edit the options in a runset file. ");
MGCAddSnippet(567, "You can create a Calibre runset file from the Calibre Interactive GUI. ");
MGCAddSnippet(568, "Each Calibre Interactive runset option has a corresponding value made up of a string of characters, one or more of a list of keywords, or a number. ");
MGCAddSnippet(569, "DRC runset options are specific to Calibre Interactive nmDRC.");
MGCAddSnippet(570, "DFM runset options are specific to Calibre Interactive DFM.");
MGCAddSnippet(571, "LVS runset options are specific to Calibre Interactive nmLVS.");
MGCAddSnippet(572, "PERC runset options are specific to Calibre Interactive PERC.");
MGCAddSnippet(573, "PEX runset options are specific to Calibre Interactive PEX.");
MGCAddSnippet(574, "The common runset options are used by all Calibre Interactive applications.");
MGCAddSnippet(575, "The waiver runset options apply to DRC, LVS, and DFM-CFA applications. With the exception of cmnSpecifyWaiverSetupFile, all control settings are on the Inputs pane in the Waivers tab of Calibre Interactive.");
MGCAddSnippet(576, "The 3DSTACK runset options are specific to Calibre Interactive 3DSTACK.");
MGCAddSnippet(577, "Template parameters allow you to define certain Calibre Interactive GUI settings based on the layout or schematic database open in your design tool. These template parameters are saved in the runset. ");
MGCAddSnippet(578, "A Calibre Interactive runset is a text file created by Calibre Interactive to store the settings you specify in the GUI. You can load a runset into Calibre Interactive xACT to restore the GUI interface to the saved settings.");
MGCAddSnippet(579, "Calibre Interactive runset files are built automatically using the Calibre Interactive GUI. Although not recommended, it is possible to manually edit the options in a runset file.");
MGCAddSnippet(580, "The general runset options have the prefix cmn. ");
MGCAddSnippet(581, "The Calibre Interactive xACT-specific runset options have the prefix pex. ");
MGCAddSnippet(582, "File-naming templates for the Calibre Interactive xACT GUI are saved to the runset as function calls. ");
MGCAddSnippet(583, "Trigger definitions for Calibre Interactive xACT are saved to the runset as an object definition. ");
MGCAddSnippet(584, "");
MGCAddSnippet(585, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

